import React from "react";
import { useForm } from "react-hook-form";
const LoginPage = (props) => {
  const { register } = useForm();
  return (
    <div className=" w-full h-[100vh] mt-16 px-4">
      <div className=" flex flex-col justify-center items-center py-10">
        <h3 className=" text-3xl">병관마켓</h3>
        <div>
          <h4>로그인</h4>
          <form action="" className="">
            <input {...register("id")} type="text" className=" bg-red-300" />
            <input type="password" className=" bg-red-300" />
          </form>
        </div>
        <div>
          <div>비밀번호 찾기</div>
          <div>아이디 찾기</div>
          <div>회원가입</div>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
